import React from 'react';
import Movielist from '../components/Movielist';

import '../styles/App.css';

const Homepage = (props) => {

  const {
    isFetching,
    movies,
  } = props;

  const {
    popular,
    genres,
  } = movies;

  const {
    action,
    comedy,
    horror,
    romance,
    scifi,
    thriller,
  } = genres;

  const genresList = [
    {
      title: 'Trending now',
      items: popular,
      id: 'popular'
    },
    {
      title: 'Action',
      items: action,
      id: 'action'
    },
    {
      title: 'Comedy',
      items: comedy,
      id: 'comedy'
    },
    {
      title: 'Horror',
      items: horror,
      id: 'horroe'
    },
    {
      title: 'Romance',
      items: romance,
      id: 'romance'
    },
    {
      title: 'Sci-fi',
      items: scifi,
      id: 'scifi'
    },
    {
      title: 'Thriller',
      items: thriller,
      id: 'thriller'
    }
  ];

  return genresList.map((genre) => (
    <Movielist
      key={genre.id}
      isFetching={isFetching}
      title={genre.title}
      movies={genre.items}
      id={genre.id}
    />
  ));
};

export default Homepage;
